// src/components/Contact.jsx
const Contact = () => (
    <section id="contact">
      <h2 className="center">Contact</h2>
      <p className="center">If you'd like to get in touch, feel free to reach out:</p>
      <ul className="contact-list center">
        <li>Email: <a href="mailto:karun.gopal@gmail.com">karun.gopal@gmail.com</a></li>
        <li>LinkedIn: <a href="https://www.linkedin.com/in/karun-gopal/" target="_blank">karun-gopal</a></li>
        <li>GitHub: <a href="https://github.com/karungop" target="_blank">karungop</a></li>
      </ul>
    </section>
  );

  export default Contact;
